import {Link} from 'react-router-dom';
import {Stack,Spacer,Flex,Button,Text,Image,Grid,GridItem,Box} from '@chakra-ui/react';

const link = [
    {
        to:"/",
        title:"Home"
    },
    {
        to:"/Meal-Deals",
        title:"Meal Deals"
    },
    {
        to:"/KindMoments",
        title:"KindMoments"
    },
    {
        to:"/Hot-Picks",
        title:"Hot Picks"
    },
    {
        to:"/Recipes",
        title:"Recipes"
    },
    {
        to:"/Directory",
        title:"Directory"
    },
    {
        to:"/Articles",
        title:"Articles"
    },
    {
        to:"/Help",
        title:"Help"
    }
]
function Navbar(){
    return(
        <Stack>
            <Flex border="1px solid red" height="90px" paddingLeft="30px" paddingRight="30px">
                <Box pl='5'>
                    <Link to='/'>
                        <Image src="https://www.kindmeal.my/images/logo-kindmeal.png"/>
                    </Link>
                </Box>
                <Spacer/>
                <Flex p='5'>
                    <Box>
                        <Link to='/'>
                            <Image width="40px" height="40px" src="https://www.kindmeal.my/images/follow_blog_grey.png"/>
                        </Link>
                    </Box>
                    <Box>
                        <Link to='/'>
                            <Image width="40px" height="40px" src="https://www.kindmeal.my/images/follow_facebook_grey.png"/>
                        </Link>
                    </Box>
                    <Box>
                        <Link to='/'>
                            <Image width="40px" height="40px" src="https://www.kindmeal.my/images/follow_twitter_grey.png"/>
                        </Link>
                    </Box>
                </Flex>
                <Spacer/>
                <Flex mr='5' p='5'>
                    <Box p='3'>Login </Box>
                    <Box >
                        <Button height="20px" >Facebook</Button>&nbsp;&nbsp;
                        <Button>Email</Button>
                    </Box>
                    <Box p='3'>Signup</Box>
                </Flex>
            </Flex>
            <Box></Box>
        </Stack>
    )
}

export default Navbar;
